import React from "react";
// import store from "../redux/store";
import {Link} from 'react-router-dom'


export default class Login extends React.Component {


  render() {
    console.log(this.props.newUser)
    return (
      <div>
             {this.props.newUser ? <Link to='/login'> <button>Click Here To Go To Login Page</button></Link> 
             : <Link to='/signup'> <button>Click Here To Sign Up!</button></Link>
        }
        <p>
        {this.props.newUser ? 'Sign Up Here!' : 'Please log in'}</p>
        <form onSubmit={(event) => this.props.handleUser(event, this.props.newUser)}>
          <label name="name">Name</label>
          <input name="name" />
          <br />
          <label name="name">Password</label>
          <input name="password" type="password" />
          <br />
           <button>{this.props.newUser ? 'Create User' : 'Login'}</button>
        </form>

      </div>
    );
  }
}
